import React from "react"
import styles from "./Card.module.css"


class CardBody extends React.Component {
  render() {
    console.log(styles.card)
    return (
      <div className={styles.cardBody}>
        <p className={styles.date}>{this.props.data.startTime}</p>
        <p classname={styles.date}>{this.props.data.endTime}</p>
        <h2>Emotions</h2>
        <p className={styles.bodyContent}>Happy: {this.props.data.happy}%</p>
        <p className={styles.bodyContent}>Sad: {this.props.data.sad}%</p>
        <p className={styles.bodyContent}>Angry: {this.props.data.angry}%</p>
        <p className={styles.bodyContent}>Disgust: {this.props.data.disgust}%</p>
        <p className={styles.bodyContent}>Surprised: {this.props.data.surprised}%</p>
        <p className={styles.bodyContent}>Fearfull: {this.props.data.fearfull}%</p>
        <p className={styles.bodyContent}>Neutral: {this.props.data.neutral}%</p>
      </div>
    )
  }
}

class Card extends React.Component {
  render() {
    return (
      <article className={styles.card}>
        <CardBody data = {this.props.data}/>
      </article>
    )
  }
}

export default Card
